import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { library }  from '@fortawesome/fontawesome-svg-core';
import { faEyeSlash, faEye , faPlusSquare } from '@fortawesome/free-regular-svg-icons';
import { faTimes, faCheck, faChevronDown, faPaperclip } from '@fortawesome/free-solid-svg-icons';

library.add(faEyeSlash, faEye, faPlusSquare, faTimes, faCheck, faChevronDown, faPaperclip);

export const EyeSlash = () => <FontAwesomeIcon icon={faEyeSlash}/>;

export const Eye = () => <FontAwesomeIcon icon={faEye}/>;

export const PlusSign = () => <FontAwesomeIcon icon={faPlusSquare} size='lg'/>

export const Times = () => <FontAwesomeIcon icon={faTimes} size='lg'/>

export const Check = () => <FontAwesomeIcon icon={faCheck} size='xs'/>

export const ChevronDown = () => <FontAwesomeIcon icon={faChevronDown} size='xs'/>

export const Paperclip = () => <FontAwesomeIcon icon={faPaperclip} size='m'/>
